import React from 'react';

export default function Home() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px', color: 'red' }}>
      <h1>Welcome to OSRS Challenge Hub</h1>
      <p style={{ color: 'rgb(240, 95, 5)' }}>This is the home page.</p>

    </div>
  );
}
